ocked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Grid Accent 6\\\\\" ></w:LsdException>\r\n</w:LatentStyles></xml><![endif]--><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 瓷砖铺贴是每个人在装修房间时都需要了解的，尤其是近年来人们越来越喜欢亲力亲为，人人化身</span><span style=\\\\\"font-family: 宋体; text-decoration: underline;\\\\\" class=\\\\\"15\\\\\">装修设计</span><span style=\\\\\"font-family: 宋体;\\\\\">师。瓷砖铺贴是装修的基础，完美的瓷砖铺贴是家庭装修最重要的一步。那么，有哪些瓷砖铺贴注意事项？</span></span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 第一，从选好瓷砖开始。按照装修不同区域而针对性的选择瓷砖。卫生间瓷砖要选吸水防滑的色彩含蓄淡雅的；厨房瓷砖也要选吸水防滑的，色彩上可以更明亮，提高食欲；</span><span style=\\\\\"font-family: 宋体; text-decoration: underline;\\\\\" class=\\\\\"15\\\\\">客厅瓷砖</span><span style=\\\\\"font-family: 宋体;\\\\\">要选耐磨低吸水率的等等。在购买瓷砖时，为了保证瓷砖的高质，很多人会选择购买知名品牌的产品，如佛山十大瓷砖品牌之一的哈德逊瓷砖，专注十年出口瓷砖，瓷砖质量符合国际标准，产品远销欧美、非洲、中东地区，即使在反倾销硝烟四起的</span><span style=\\\\\"font-family: 宋体; text-decoration: underline;\\\\\" class=\\\\\"15\\\\\">瓷砖行业</span><span style=\\\\\"font-family: 宋体;\\\\\">环境下，<font face=\\\\\"Times New Roman\\\\\">2014</font><font face=\\\\\"宋体\\\\\">年的销售额也达到了亿量级别，是佛山瓷砖界的最强黑马。</font></span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 第二，选购好瓷砖后，在开始铺贴瓷砖之前，不要忘了&ldquo;地面找平&rdquo;。很多人以为地面找平只是在铺木地板的时候才需要，但其实在瓷砖铺贴时也是一个很重要的前期工作。所谓地面找平，要先检测地面的平整程度，一般方法是找一根长约<font face=\\\\\"Times New Roman\\\\\">2m</font><font face=\\\\\"宋体\\\\\">的靠尺，用靠尺在同一地面进行交叉位置的测量，看靠尺与地面间是否有空隙，如果有了</font><font face=\\\\\"Times New Roman\\\\\">3mm</font><font face=\\\\\"宋体\\\\\">以上的空隙，着地面就是不平整的，需要找平。地面找平是至关重要的一步，做好了会对以后瓷砖铺贴省下不少麻烦。</font></span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 第三，地面找平之后，在瓷砖铺贴前，应该先将瓷砖在水中浸泡<font face=\\\\\"Times New Roman\\\\\">30min</font><font face=\\\\\"宋体\\\\\">以上。因为瓷砖都会有一定程度的吸水，如果不浸泡够</font><font face=\\\\\"Times New Roman\\\\\">30min</font><font face=\\\\\"宋体\\\\\">，瓷砖铺贴之后会吸收水泥浆中的水分，容易造成瓷砖松脱，这样瓷砖铺贴就不持久了。而且，一些吸水率低的瓷砖，应该适当的延长浸泡时间。瓷砖铺贴前应阴干。</font></span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align: center;\\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;<img width=\\\\\"550\\\\\" height=\\\\\"387\\\\\" align=\\\\\"middle\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-26/ae9c139edf5949f73466dd22b640012a.jpg\\\\\" alt=\\\\\"瓷砖铺贴,瓷砖铺贴技注意事项,瓷砖铺贴技巧.jpg\\\\\" /></span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 第四，前期工作都准备好之后，可以开始铺贴瓷砖了。为了让瓷砖铺贴线条平整，在铺贴前要在地面上划&ldquo;十&rdquo;字形基准线，同时，如果边缘处地砖需要切割，要保证其面积至少是切割前地砖面积的一半以上，这是为了减少铺贴地砖面积突然减少的突兀感。</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 第五，瓷砖铺贴完之后，在<font face=\\\\\"Times New Roman\\\\\">24h</font><font face=\\\\\"宋体\\\\\">内必须洒水养护，完全干透后才能行走。</font></span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 最后提醒一点，卫生间和厨房在瓷砖铺贴时，应保持一定的倾斜度，以便于积水的流走。</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; font-style: normal;\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 文章来源：哈德逊瓷砖编辑原创</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; font-style: normal;\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 转载请注明出处</span><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; text-decoration: underline; font-style: normal;\\\\\" class=\\\\\"15\\\\\">http://www.hudsonhome.cn</span><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; text-decoration: underline; font-style: normal;\\\\\" class=\\\\\"15\\\\\">&ensp;</span></span></p>\r\n<p>&nbsp;</p>');");
E_D("replace into `phome_ecms_news_data_1` values('1908','51','1904','1','0','0','0','','','','<p><span style=\\\\\"font-family: 宋体; font-size: 10.5pt;\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 随着生活水平的上升，住久了的旧房子越来越跟不上现代人的审美。人们留恋着那片土地，在不搬迁的基础上，很多人都在谋划或者正在进行旧房改造。无论是想打造哪种<u>装修风格</u>，在旧房的架构改造上，都不可任性。这涉及到房屋的整体受力分析，如果随意改变房屋架构，使得受力不均，最终造成房屋倒塌，也不是没发生过的事。不过各位未来的新房主人不必过于担心，哈德逊小编将在此详述旧房装修改造时必备的家装知识，只要认真遵守，在旧房改造上是不会出太大问题的。</span></p>\r\n<p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState=\\\\\"false\\\\\"  DefUnhideWhenUsed=\\\\\"true\\\\\"  DefSemiHidden=\\\\\"true\\\\\"  DefQFormat=\\\\\"false\\\\\"  DefPriority=\\\\\"99\\\\\"  LatentStyleCount=\\\\\"260\\\\\" >\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Normal\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 1\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 2\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 3\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 4\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 5\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 7\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 8\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\