ception Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Shading Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Grid Accent 6\\\\\" ></w:LsdException>\r\n</w:LatentStyles></xml><![endif]--></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"mso-list:l0 level1 lfo1; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">一、</span></span><strong><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">LESS&nbsp;IS&nbsp;MORE<font face=\\\\\"宋体\\\\\">的简约装修风格</font></span></span></strong></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">Less&nbsp;is&nbsp;more<font face=\\\\\"宋体\\\\\">的概念来自德国包豪斯学校的第三任校长密斯&middot;凡&middot;德罗。在当时世界大战的经济萧条背景下，极简主义装修风格迅速受到人们欢迎。人们推陈出新，从瓷砖的选择到家具的选择都体现了将小空间价值最大化的理念。</font></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><a href=\\\\\"http://www.hudsonhome.cn\\\\\"><span style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\" class=\\\\\"15\\\\\">哈德逊瓷砖</span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">市场总监说，&ldquo;简约就是简单而有品位，这种品位体现在设计上的细节的把握。每一个细小的局部和装饰，都要深思熟虑，在施工上更要求精工细作，是一种不容易达到的效果。简约不等于简单，简约是用简洁的手法，体现平面的尺度，空间感。&rdquo;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"mso-list:l0 level1 lfo1; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">二、</span><strong><span style=\\\\\"font-family: 宋体;\\\\\">随性奔放的美式乡村装修风格</span></strong></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">美式乡村风格就如那首《</span><span style=\\\\\"font-family: 宋体;\\\\\">country&nbsp;road<font face=\\\\\"宋体\\\\\">》一样，让人有种归于田园的感觉，</font></span><span style=\\\\\"font-family: 宋体;\\\\\">美式乡村</span><span style=\\\\\"font-family: 宋体;\\\\\">装修</span><span style=\\\\\"font-family: 宋体;\\\\\">风格有务实、规范、成熟的特点，带着浓浓的乡村气息，以享受为最高原则。乡村</span><span style=\\\\\"font-family: 宋体;\\\\\">家装设计</span><span style=\\\\\"font-family: 宋体;\\\\\">风格的色彩多以自然色调为主，绿色、土褐色较为常见，特别是墙面色彩选择上，自然、怀旧、散发着质朴气息的色彩成为首选。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"mso-list:l0 level1 lfo1; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">三、</span><strong><span style=\\\\\"font-family: 宋体;\\\\\">把爱琴海搬回家的地中海装修风格</span></strong></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">地中海风格的特点是大面积的蓝白结合，除此之外，</span><span style=\\\\\"font-family: 宋体;\\\\\">还有沙滩色、草绿色、土黄色、红褐色等等，但色彩不宜过多，重在突出地中海风格粗犷、</span><span style=\\\\\"font-family: 宋体;\\\\\">自然田园</span><span style=\\\\\"font-family: 宋体;\\\\\">的特点。</span><span style=\\\\\"font-family: 宋体;\\\\\">在瓷砖的选择上多以</span></span><span><a href=\\\\\"http://www.hudson.com/xwzx/qyxw/2015-03-23/1870.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\" class=\\\\\"15\\\\\">仿古砖</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">为主。</span><span style=\\\\\"font-family: 宋体;\\\\\">地中海风格</span><span style=\\\\\"font-family: 宋体;\\\\\">保持简单的意念，捕捉光线、取材大自然，大胆而自由的运用色彩、样式。有时候大胆的搭配也不是坏事。</span><span style=\\\\\"font-family: 宋体;\\\\\">把爱琴海搬回家的地中海风格让居住在内的人有如身临其境，尽享希腊人民舒适优雅的生活</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align: center;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;<img width=\\\\\"550\\\\\" height=\\\\\"319\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-27/0cdc38a1d3dfdabcd2039ed24996e68e.jpg\\\\\" alt=\\\\\"家装设计风格,装修风格分类.jpg\\\\\" /></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"mso-list:l0 level1 lfo1; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">四、</span><strong><span style=\\\\\"font-family: 宋体;\\\\\">高调奢靡的洛可可装修风格</span></strong></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">洛可可风格是路易十五统治时期，流行于法国、遍及欧洲的一种艺术风格。洛可可家装设计风格与巴洛克风格的色彩浓烈、喧嚣放肆相比，洛可可追求的是追求华美和闲适，洛可可风格的家居通常具有轻盈、华丽、精致、细腻等特点。甚至有人比喻洛可可风格是巴洛克风格的颓废和瓦解阶段。然而，洛可可家装设计风格自有它骨子里的高贵典雅，才一直留存至今，依旧深受人们喜爱。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"mso-list:l0 level1 lfo1; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">五、</span><strong><span style=\\\\\"font-family: 宋体;\\\\\">五千年岁月沉淀的中式装修风格</span></strong></span></p>\r\n<p style=\\\\\"mso-pagination:none; text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"mso-pagination:none; text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">说到中式风格，相信很多人都不陌生。中式风格很大一个特点就是&mdash;&mdash;红，红木家具是很多中式风格家庭必备单品。中式风格非常重视空间的层次感，多用屏风和窗棂来分割，且在屏风和窗棂上画上山水画和雕窗花，尤其有古代庭院的感觉。</span></span></p>\r\n<p style=\\\\\"mso-pagination:none; text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"mso-pagination:none; text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">哈德逊瓷砖为了迎合广大消费者的个性化家居装修爱好，旗下产品覆盖众多装修风格，有适合美式乡村风格的仿木纹砖、给你整个爱琴海的蓝色格子、</span><span style=\\\\\"font-family: 宋体;\\\\\">less&nbsp;is&nbsp;more<font face=\\\\\"宋体\\\\\">的白色瓷砖等等，最大程度的满足追求生活品质的你。更是有</font></span></span><span><a href=\\\\\"http://www.hudsonbuy.com\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\" class=\\\\\"15\\\\\">易家亲建材网上商城</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">，让你足不出户把装修搞定。</span></span></p>\r\n<p style=\\\\\"mso-pagination:none; text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"mso-pagination:none; text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"margin-left:0.0000pt; text-indent:21.0000pt; mso-pagination:widow-orphan; text-align:left; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; font-style: normal;\\\\\">文章来源：哈德逊瓷砖编辑原创</span></span></p>\r\n<p style=\\\\\"text-indent:21.0000pt; mso-char-indent-count:2.0000; mso-pagination:none; text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; font-style: normal;\\\\\">转载请注明出处</span><a href=\\\\\"http://www.hudsonhome.cn\\\\\"><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; font-style: normal;\\\\\">http://www.hudsonhome.cn</span></a></span></p>\r\n<p>&nbsp;</p>');");
